import React from "react";
import style from "./MyPosts.module.css";

const MyPosts = (props) => {
    return (
        <div className={style.mp}>
            <i className="fas fa-user-circle" alt="ava" />
            <span className={style.sp}>{props.message}</span>
        </div>
    );
}

export default MyPosts;
